    'help.WhatShouldIDoIfISuspectAFraudulentSeller': '\u0427\u0442\u043E \u0434\u0435\u043B\u0430\u0442\u044C, \u0435\u0441\u043B\u0438 \u044F \u043F\u043E\u0434\u043E\u0437\u0440\u0435\u0432\u0430\u044E \u043F\u0440\u043E\u0434\u0430\u0432\u0446\u0430-\u043C\u043E\u0448\u0435\u043D\u043D\u0438\u043A\u0430?',
    'help.WhatShouldIDoIfISuspectAFraudulentSeller_content': '\u0415\u0441\u043B\u0438 \u0412\u044B \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0435, \u0447\u0442\u043E \u043E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u0435 \u043D\u0430 \u0441\u0430\u0439\u0442\u0435 \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u043E\u0431\u043C\u0430\u043D\u043E\u043C \u0438\u043B\u0438 \u043F\u043E\u043F\u044B\u0442\u043A\u043E\u0439 \u043C\u043E\u0448\u0435\u043D\u043D\u0438\u0447\u0435\u0441\u0442\u0432\u0430, \u043F\u043E\u0436\u0430\u043B\u0443\u0439\u0441\u0442\u0430, \u0441\u043E\u043E\u0431\u0449\u0438\u0442\u0435 \u043D\u0430\u043C \u043E\u0431 \u044D\u0442\u043E\u043C, \u0432\u043E\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0432\u0448\u0438\u0441\u044C \u0441\u0441\u044B\u043B\u043A\u043E\u0439 <<CONTACTLINK>>\u041F\u0440\u0430\u0432\u043E\u0432\u044B\u0435 \u0432\u043E\u043F\u0440\u043E\u0441\u044B<</CONTACTLINK>>.',
    'terms.TermsOfUse': '\u0423\u0441\u043B\u043E\u0432\u0438\u044F \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u044F',
    'about.AboutBrand': '\u041E \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0438 OLX',
    'about.AboutText1': 'OLX \u2014 \u044D\u0442\u043E \u0432\u0435\u0434\u0443\u0449\u0430\u044F \u043F\u043B\u0430\u0442\u0444\u043E\u0440\u043C\u0430 \u0434\u043B\u044F \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u0438\u044F \u043E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u0439 \u043D\u0430 \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u044E\u0449\u0438\u0445\u0441\u044F \u0440\u044B\u043D\u043A\u0430\u0445 (\u043A\u0430\u043A \u043E\u043D\u043B\u0430\u0439\u043D, \u0442\u0430\u043A \u0438 \u043D\u0430 \u043C\u043E\u0431\u0438\u043B\u044C\u043D\u044B\u0445 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430\u0445).',
    'about.AboutText2': 'OLX \u0440\u0430\u0431\u043E\u0442\u0430\u0435\u0442 \u043F\u043E \u0432\u0441\u0435\u043C\u0443 \u043C\u0438\u0440\u0443 \u0438 \u0438\u043C\u0435\u0435\u0442 \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0430 \u0431\u043E\u043B\u0435\u0435 \u0447\u0435\u043C \u0432 40 \u0441\u0442\u0440\u0430\u043D\u0430\u0445.',
    'about.about_Body': '<p>OLX - \u044D\u0442\u043E \u043D\u043E\u0432\u043E\u0435 \u043F\u043E\u043A\u043E\u043B\u0435\u043D\u0438\u0435 \u0441\u0430\u0439\u0442\u043E\u0432 \u0431\u0435\u0441\u043F\u043B\u0430\u0442\u043D\u044B\u0445 \u043E\u043D\u043B\u0430\u0439\u043D-\u043E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u0439.<br /><br />OLX \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u043F\u0440\u043E\u0441\u0442\u043E\u0435 \u0440\u0435\u0448\u0435\u043D\u0438\u0435 \u0432\u0441\u0435\u0445 \u0441\u043B\u043E\u0436\u043D\u043E\u0441\u0442\u0435\u0439, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0441\u043E\u043F\u0440\u043E\u0432\u043E\u0436\u0434\u0430\u044E\u0442 \u043F\u0440\u043E\u0446\u0435\u0441\u0441 \u043F\u0440\u043E\u0434\u0430\u0436\u0438, \u043F\u043E\u043A\u0443\u043F\u043A\u0438, \u0442\u043E\u0440\u0433\u043E\u0432\u043B\u0438, \u043E\u0431\u0441\u0443\u0436\u0434\u0435\u043D\u0438\u044F \u0438 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438 \u0441\u0434\u0435\u043B\u043A\u0438, \u0430 \u0442\u0430\u043A\u0436\u0435 \u0432\u0441\u0442\u0440\u0435\u0447\u0438 \u043B\u044E\u0434\u0435\u0439 \u0440\u044F\u0434\u043E\u043C \u0441 \u0412\u0430\u043C\u0438, \u0433\u0434\u0435 \u0431\u044B \u0412\u044B \u043D\u0435 \u043D\u0430\u0445\u043E\u0434\u0438\u043B\u0438\u0441\u044C. <br /><br /> OLX - \u044D\u0442\u043E:<br /><ul><li>\u041F\u0440\u043E\u0441\u0442\u043E\u0439 \u0441\u043F\u043E\u0441\u043E\u0431 \u0441\u043E\u0437\u0434\u0430\u0442\u044C \u044D\u0444\u0444\u0435\u043A\u0442\u043D\u043E\u0435 \u0440\u0435\u043A\u043B\u0430\u043C\u043D\u043E\u0435 \u043E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u0435 \u0441 \u0438\u043B\u043B\u044E\u0441\u0442\u0440\u0430\u0446\u0438\u044F\u043C\u0438</li><li>\u041B\u0435\u0433\u043A\u043E\u0435 \u0443\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u0435 \u043F\u0440\u043E\u0434\u0430\u0436\u0435\u0439, \u043F\u043E\u043A\u0443\u043F\u043A\u043E\u0439 \u0438 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0439 \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u044C\u044E \u0432 \u0440\u0430\u0437\u0434\u0435\u043B\u0435 "\u041C\u043E\u0439 OLX"</li><li>\u0412\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u043E\u0442\u043E\u0431\u0440\u0430\u0436\u0435\u043D\u0438\u044F \u043E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u0439 \u043D\u0430 \u0412\u0430\u0448\u0435\u0439 \u0441\u0442\u0440\u0430\u043D\u0438\u0447\u043A\u0435 \u0432 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0445 \u0441\u0435\u0442\u044F\u0445 (Facebook, Myspace, ...)</li><li>\u0414\u043E\u0441\u0442\u0443\u043F \u043A \u0441\u0430\u0439\u0442\u0443 \u0447\u0435\u0440\u0435\u0437 \u0412\u0430\u0448 \u043C\u043E\u0431\u0438\u043B\u044C\u043D\u044B\u0439 \u0442\u0435\u043B\u0435\u0444\u043E\u043D</li><li>\u041F\u0440\u043E\u0441\u043C\u043E\u0442\u0440 \u0441\u0430\u0439\u0442\u0430 OLX \u043D\u0430 \u0412\u0430\u0448\u0435\u043C \u044F\u0437\u044B\u043A\u0435</li></ul><br />\u0423\u0441\u043B\u0443\u0433\u0430\u043C\u0438 OLX \u043F\u043E\u043B\u044C\u0437\u0443\u044E\u0442\u0441\u044F \u043D\u0430 <<QTY_LANGUAGES>> \u044F\u0437\u044B\u043A\u0430\u0445 \u0431\u043E\u043B\u0435\u0435 \u0447\u0435\u043C \u0432 <<QTY_COUNTRIES>> \u0441\u0442\u0440\u0430\u043D\u0430\u0445. OLX - \u044D\u0442\u043E \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u044F \u0437\u0430\u043A\u0440\u044B\u0442\u043E\u0433\u043E \u0442\u0438\u043F\u0430, \u043E\u0441\u043D\u043E\u0432\u0430\u043D\u043D\u0430\u044F \u0432 \u043C\u0430\u0440\u0442\u0435 2006 \u0433\u043E\u0434\u0430.</p>',
